fn convolve_samples(sample: f32, impulse_response: &[f32]) -> f32 {
    let input_signal = std::iter::once(sample).chain(std::iter::repeat(0.0));
    let output = impulse_response
        .iter()
        .rev()
        .zip(input_signal)
        .fold(0.0, |acc, (h, x)| acc + h * x);
    nih_log!("Convolved {} to {}",sample,output);
    output
}

